import React from "react";
import fickpic from "./fickster.jpg"
import "./toppicture.css"
import { Zoom } from "react-reveal";




function Toppicture () {

return(


<div className="container">
    <div className="row">
<div className = "col-md-12 margbottom divcenter">


<Zoom><img src={fickpic} className="picsize" alt="ficky"></img></Zoom>


</div>










</div>


</div>

)


}


export default Toppicture
